import React, { Component } from "react";
import { connect } from "react-redux";
import "./HomeHeader.scss";

import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
class HomeHeader extends Component {
    render() {
        return (
            // <div>
            //     <div className="home-header-container">
            //         <div className="home-header-content">
            //                 <div className="left-content">
            //                     <i className="fa fa-bars" aria-hidden="true"></i>
            //                     <div className="header-logo"></div>
            //                 </div>
            //                 <div className="center-content"></div>
            //                 <div className="right-content"></div>
            //         </div>
            //     </div>
            // </div>
             <Navbar bg="light" expand="lg">
      <Navbar.Brand href="#">Navbar</Navbar.Brand>
      <Navbar.Toggle aria-controls="navbarSupportedContent" />
      <Navbar.Collapse id="navbarSupportedContent">
        <Nav className="mr-auto">
          <Nav.Link href="#" className="nav-item active">Home <span className="sr-only">(current)</span></Nav.Link>
          <Nav.Link href="#">Link</Nav.Link>
          <NavDropdown title="Dropdown" id="navbarDropdown">
            <NavDropdown.Item href="#">Action</NavDropdown.Item>
            <NavDropdown.Item href="#">Another action</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#">Something else here</NavDropdown.Item>
          </NavDropdown>
          <Nav.Link href="#" className="nav-item disabled">Disabled</Nav.Link>
        </Nav>
        <Form inline className="my-2 my-lg-0">
          <FormControl type="search" placeholder="Search" className="mr-sm-2" aria-label="Search" />
          <Button variant="outline-success" type="submit">Search</Button>
        </Form>
      </Navbar.Collapse>
    </Navbar>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        isLoggedIn: state.user.isLoggedIn,
    };
};

const mapDispatchToProps = (dispatch) => {
    return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(HomeHeader);
